import React from "react";
import Header from "./Components/Header";
import "./App.css";
// import Listpunk from "./Components/Listpunk";
import Collectioncard from "./Components/Collectioncard";
import Sdata from "./Sdta";

function App() {
  return (
    <>
      <div className="app">
        <Header />
        <div>
          {Sdata.map((val) => {
            return (
              <Collectioncard
                pic={val.imgSrc}
                id={val.id}
                name={val.title}
                rate={val.price}
                imgs={val.img2}
              />
            );
          })}
        </div>
      </div>
    </>
  );
}

export default App;
